export class PolygonDrawerBase{draw(t,e,n){const o=this.getCenter(e,n),a=this.getSidesData(e,n),r=a.count.numerator*a.count.denominator,s=a.count.numerator/a.count.denominator,i=180*(s-2)/s,l=Math.PI-Math.PI*i/180;if(t){t.beginPath(),t.translate(o.x,o.y),t.moveTo(0,0);for(let e=0;e<r;e++)t.lineTo(a.length,0),t.translate(a.length,0),t.rotate(l)}}};